        <Box className='mainBoardCard'>
            <div>
                {props.cardTitle}
                <Box 
                sx={{
                    width: '20px',
                    height: '20px'
                }}
                    component='img'
                    src={props.icon}
                    alt='icon'
                />
                {props.icon}
            </div>
            <h1>{props.number}</h1>
            <div style={width= ''}>{props.cardFooter}</div>
        </Box>
    )
}

